	public string getJobData(string type, int id, int col){
		if (jobdata_C.Length == 0 || jobdata_M.Length == 0)
			return "0";
		switch (type) {
		case "c":
			return jobdata_C[id*(NUM_CHARACTERISTICS+1) + col];
		case "m":
			return jobdata_M[id*(NUM_JOB+1) + col+1];
		case "g":
			return jobdata_G[id];

		default:
			return "Error: Wrong Input Type";
		}
	}

	public void JobIconEnteredLane(int i){
