	}

	public bool isJobIconInLane(int i){
		return JobIconsInLane[i];
	}

	List<List<string>> ReadCSV(string dir)
	{
		StreamReader reader = new StreamReader(File.OpenRead(dir));
		List<List<string>> ret = new List<List<string>>();
		
		while (!reader.EndOfStream){
			List<string> row = new List<string>();
			string[] values = reader.ReadLine().Split(',');
			foreach (string value in values)
				row.Add(value);
			ret.Add(row);
		}
		
		return ret;
	}

	void csvConvert(string filename){
		List<List<string>> textInput;
		textInput = ReadCSV (@"Assets/Assets_TPYG_PVZ/Data/" + filename);
		TextWriter tw = new StreamWriter(@"Assets/Assets_TPYG_PVZ/Data/" + filename + ".output.csv");
		for (int i = 0; i<textInput.Count; i++) {
			string line = "";
			foreach (string value in textInput[i])
				line += "\"" + value +"\", ";
			tw.WriteLine(line);
		}
		tw.WriteLine(DateTime.Now);
		tw.Close();
	}

